import React, { Component } from 'react';

let Images = () => {
    return
    <div id="home-slider" class="home-slider">
        {[...Array(3)].map((e, i) => {
            return
            <div class="item">
                <img key={i} src={"../images/cecistyle" + i + ".jpg"} alt = "slider" />
                </div>
        })}
    </div>
}

export default class LayoutTemplateBanner extends Component {

    constructor(props) {
        super(props);
        this.state = {
            
        }
    }


    render() {

        return (
            <div class="banner haslayout">
                <div class="slider-caption">
                    <div class="box">
                        <div class="holder">
                            <div class="frame">
                                <div class="border-center">
                                    <span class="title">Great Features</span>
                                </div>
                                <div class="border-center">
                                    <h1>Our Designer <span>dresses</span></h1>
                                </div>
                                <div class="description">
                                    <p>Claritas est etiam processus dynamicus, qui sequitur mutationem consuetudium lectorum.</p>
                                </div>
                                <a class="theme-btn" href="#">Browse Now</a>
                            </div>
                        </div>
                    </div>
                </div>
            <Images/>
            </div>
        )
    }
}
